                        "Name": "サメに乗って波を切り裂くJP1M",
                        "Desc": "速度と水潮を操る術を駆使し、いつでもどこでもサーフィンの姿勢に入る。<br>発動後、ムアラニは夜魂値を60獲得し、夜魂の加護状態に入る。<br><br><color style='color:#FFD780;'>夜魂の加護 · ムアラニ</color><br>持続的に夜魂値を消費する。夜魂値が尽きた時や、再発動時、ムアラニの夜魂の加護状態は終了する。夜魂の加護状態は以下の特性を持つ。<br> · ざぶざぶサメくんに乗ることで、ムアラニの移動速度がアップする。この状態にあるムアラニは水面と液体燃素の上を移動でき、液体燃素によるダメージを無効化できる。<br> · 通常攻撃を行う時、代わりにサメサメバイトを行い、ムアラニのHP上限を基に夜魂性質の<color style='color:#80C0FF;'>水元素ダメージ</color>を与える。サメサメバイトは空中でも発動でき、与えるダメージは通常攻撃ダメージと見なされる。<br> · この状態で敵に触れると、ムアラニは敵に獲物マークを付与し、波勢チャージを1層獲得する。波勢チャージは最大3層まで重ね掛け可能。<br><br><color style='color:#FFD780;'>波勢チャージと獲物マーク</color><br>サメサメバイトを行う時、ムアラニは波勢チャージの層数を基に、与えるダメージをアップする。波勢チャージが3層の場合、ムアラニのサメサメバイトはサメサメバイト · 大波となり、与えるダメージがさらにアップする。その後、波勢チャージをクリアする。<br>サメサメバイトが敵に命中すると、その敵の獲物マークは解除される。さらに、付近の獲物マークを持っている最大5名の敵にサメサメロケットを発射して獲物マークを解除する。サメサメロケットの与えるダメージはその時のサメサメバイトのダメージに相当する。サメサメバイトとサメサメロケットの目標の敵が1名を超えている時、与えるダメージは下がり、最大28%ダウンする（敵が3名以上いる時）。<br><br><i>サメくんはサーフボードであるだけでなく、淡水ザメでもある。ただ噛みつきたいだけで、本当に相手を食べたいわけではないらしい。</i>JP0B",
